    localStorage.setItem("cookie", events.target.value);
  };
  return (
    <div>
      <input
        id="cookie"
        type={"text"}
        placeholder={"Input cookie KMA"}
        name="cookie"
        onChange={(event) => {
          onChange(event);
        }}
        value={cookie}
      ></input>
      <button onClick={() => {}}>Crawl TKB</button>
    </div>
  );
}
export default InputCookie;
